import React, { Component,useEffect } from 'react';
import './contactcut.css';
import Aos from 'aos';
import Img from './contact1.jpg';

const ContactCut = () => {

    return (
        
    	<div id="contactcut">
           <div className='par' 
            style={{backgroundImage:'url(' + Img + ')',height:'auto',maxWidth:'100%'}}>
            <div className='ovr'>
            <h3 style={{color:'white'}}>
            If you want to talk about any opportunity or just want to say Hi, drop a message.</h3>
            </div>
            </div>
            
        </div>
    );
}

export default ContactCut;
